import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react'
import axios from 'axios'

class App extends Component{
  constructor(props){
    super(props)

    axios
      .get('/')
      .then(resultado => { 
        console.log(resultado)
       })
  }
}
